// src/main.js
import { createApp } from 'vue';
import App from './App.vue';
import router from './router';
import './assets/styles/main.css';

// Khởi tạo ứng dụng Vue
const app = createApp(App);

// Sử dụng Vue Router
app.use(router);

// Mount ứng dụng
app.mount('#app');
